import React from "react";
import "./App.css";
import ProductsGrid from "./components/products";
import Navb from "./components/navbar";
import Hero from "./components/hero";

function App() {
  return (
    <div className="App">
      <Navb />
      <Hero />
      <ProductsGrid />
    </div>
  );
}

export default App;
